var scpPattern = new RegExp("http://scp-wiki-cn.wikidot.com/scp-[0-9]")
if (scpPattern.test(window.location.href)) {
	console.log("[ZhihuBlocker]: SCP Additional Information Added.");
	var addTitle = function(titleElement, key) {
		titleElement.text(titleElement.text()+scpData[key]);
	}
	var beforeShow = function(number, titleElement, contentElement) {
		var key = 'scp-' + number;
		addTitle(titleElement, key);
	}
	var init = function() {
		var number = window.location.href.slice(35);
		var pageTitle = $('#page-title');
		var pageContent = $('#page-content');
		beforeShow(number, pageTitle, pageContent);
		var style = 'style="font-size: 130%; cursor: pointer;"';
		pageContent.after(`
			<br/>
			<a id="z-next" ${style} >下一页</a>
		`);
		return {
			number,
			pageTitle,
			pageContent
		};
	}
	var { number, pageTitle, pageContent } = init();
	var nextNumber, nextPageTitle, nextPageContent;

	var preload = function() {
			nextNumber = leftPad(parseInt(number) + 1, number.length, 0);
			var nextHref = 'http://scp-wiki-cn.wikidot.com/scp-' + nextNumber;
			$.get(nextHref, function(data) {
				nextPageTitle = $('#page-title', data);
				nextPageContent = $('#page-content', data);
				nextPageTitle.css('display', 'none');
				nextPageContent.css('display', 'none');
				// after 是倒序插入
				pageContent.after(nextPageContent);
				pageContent.after(nextPageTitle);
				beforeShow(nextNumber, nextPageTitle, nextPageContent);
			})
	}
	preload();
	var onClick = function() {
		nextPageTitle.css('display', 'block');
		nextPageContent.css('display', 'block');
		pageTitle.css('display', 'none');
		pageContent.css('display', 'none');
		number = nextNumber;
		pageTitle = nextPageTitle;
		pageContent = nextPageContent;
		$(window).scrollTop(0);
		preload();
	}
	$('#z-next').click(onClick);
}
